INSERT INTO `obo_checklist_master` VALUES ('FSC01', 'FSEC_CHECKLIST', 1, 'Building exits must abut a public street or approved alley. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC02', 'FSEC_CHECKLIST', 2, 'Provide at least two (2) means of egress for each floor, room. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC03', 'FSEC_CHECKLIST', 3, 'Provide secondary stair/exit as far/remote from main stair/entrance/exit, to serve _the whole area__. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC04', 'FSEC_CHECKLIST', 4, 'Enclose all stairways and fire escapes with walls having {0} hours of fire resistance with access thru self-closing fire doors. ', 'MEANS OF EGRESS ', 'd');
INSERT INTO `obo_checklist_master` VALUES ('FSC05', 'FSEC_CHECKLIST', 5, 'Provide two (2) doors as exit ways from all rooms. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC06', 'FSEC_CHECKLIST', 6, 'Interconnect stairs and fire escapes with fire resistive passageways on corridors at least {0} meters wide. ', 'MEANS OF EGRESS ', 'd');
INSERT INTO `obo_checklist_master` VALUES ('FSC07', 'FSEC_CHECKLIST', 7, 'Enclose walls, doors, stairs ramps, escalators and other components of exits systems. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC08', 'FSEC_CHECKLIST', 8, 'Provide protected/enclosed horizontal exits with self-closing fire doors. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC09', 'FSEC_CHECKLIST', 9, 'Travel distance to an exit shall not be more than {0}  meters. ', 'MEANS OF EGRESS ', 'd');
INSERT INTO `obo_checklist_master` VALUES ('FSC10', 'FSEC_CHECKLIST', 10, 'Exit doors shall swing in the direction of exit travel. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC11', 'FSEC_CHECKLIST', 11, 'Revolving doors shall not be used as means of egress except {0}', 'MEANS OF EGRESS ', 's');
INSERT INTO `obo_checklist_master` VALUES ('FSC12', 'FSEC_CHECKLIST', 12, 'Exit door should have a minimum width of 71 cm and a maximum width 122 cm and shall not restrict the opening. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC13', 'FSEC_CHECKLIST', 13, 'Exit door/s should be openable from the inside without the use of keys, special knowledge or effort flush bolts or surface bolts are prohibited. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC14', 'FSEC_CHECKLIST', 14, 'A floor or landing is required not less than the width of exit door. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC15', 'FSEC_CHECKLIST', 15, 'Door should be not project into the required corridor width when fully opened so as not to reduced the corridor width to less than 76.17 cm. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC16', 'FSEC_CHECKLIST', 16, 'Exit doors should provide immediate access to an approved means of egress. Exiting through a bathroom, bedroom or other room subject to locking does not comply. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC17', 'FSEC_CHECKLIST', 17, 'Corridors should have a minimum width of {0} meters. ', 'MEANS OF EGRESS ', 'd');
INSERT INTO `obo_checklist_master` VALUES ('FSC18', 'FSEC_CHECKLIST', 18, 'Required corridors in {0} occupancies shall have 2.43 meters (8 ft) minimum width. ', 'MEANS OF EGRESS ', 's');
INSERT INTO `obo_checklist_master` VALUES ('FSC19', 'FSEC_CHECKLIST', 19, 'Dead-end corridors and exit balconies is limited to 6.08 m (20 ft). ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC20', 'FSEC_CHECKLIST', 20, 'Aisles in auditorium shall be minimum of {0} meters in width. ', 'MEANS OF EGRESS ', 'd');
INSERT INTO `obo_checklist_master` VALUES ('FSC21', 'FSEC_CHECKLIST', 21, 'Walls and ceilings of corridors should be fire resistive construction materials. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC22', 'FSEC_CHECKLIST', 22, 'Interior openings into corridor should be protected as set forth in {0}. ', 'MEANS OF EGRESS ', 's');
INSERT INTO `obo_checklist_master` VALUES ('FSC23', 'FSEC_CHECKLIST', 23, 'Main stairways should have a minimum width of 112 cm. Trims and handrails should not project more than 8.90 cm (3 1/2 in) into the required width. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC24', 'FSEC_CHECKLIST', 24, 'Landings on stairways should have a minimum dimension of 112 cm (44 in) in the direction of travel. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC25', 'FSEC_CHECKLIST', 25, 'Risers on stairways should not exceed 19 cm and tread exclusive of nosing or projections should not be less than 25 cm. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC26', 'FSEC_CHECKLIST', 26, 'Doors between guests rooms and corridors shall be self-closing and shall have a fire protection rating at least twenty (20) minutes. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC27', 'FSEC_CHECKLIST', 27, 'Openings in corridor partitions other than door openings shall be prohibited. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC28', 'FSEC_CHECKLIST', 28, 'Basement portion of stairways should be provided with an approved barrier where continuous to upper floor in an exit enclosure. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC29', 'FSEC_CHECKLIST', 29, 'Vertical distance between stairway landings are limited to 3.69 m (12 ft) in assembly occupancies, distance is 2.43 m (8 ft) ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC30', 'FSEC_CHECKLIST', 30, 'Handrails should be placed not less than 81.28 cm (32 in) above the tread. Two (2) handrails are required when stairways exceed 111.7 cm in width. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC31', 'FSEC_CHECKLIST', 31, 'Guardrails for stairs, balconies, stair landings, ramps & aisles located along the edge of openside floors and mezzanines shall be provided. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC32', 'FSEC_CHECKLIST', 32, 'There shall be no enclosed usable space under the stairs in an exit enclosure nor shall the open space under such stairs be used for any purpose. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC33', 'FSEC_CHECKLIST', 33, 'Non-combustible outside stairs are required to have 2.03 m (6 ft, 8 in) minimum headroom clearance for stairways which should be indicated on plans. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC34', 'FSEC_CHECKLIST', 34, 'Ramp slopes should have be roughened or with nonslip surface. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC35', 'FSEC_CHECKLIST', 35, 'Ramp slopes should not exceed 30.3 cm. (1 ft) in 3.03 m (10 ft.). ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC36', 'FSEC_CHECKLIST', 36, 'No openings other than the required exits are permitted and exit passageways should be one (1) hr fire resistive construction for a three (3) storey building or less and two (2) hrs for four (4) storey building or more. Any opening therein shall be protected with an approved self-closing fire doors. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC37', 'FSEC_CHECKLIST', 37, 'Exit illumination and directional EXIT signs shall be provided. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC38', 'FSEC_CHECKLIST', 38, 'Panic hardware is required on exit doors. In lieu of this, doors shall have no locks or latches. ', 'MEANS OF EGRESS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC39', 'FSEC_CHECKLIST', 39, 'Provide fire break up to the roof for ceiling areas. ', 'COMPARTMENTATION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC40', 'FSEC_CHECKLIST', 40, 'Provide monitored and curtained roof of sheetmetal or non-combustible material of a minimum of 1.82m (6 ft) high spaced not more than 76 m (250 ft) & curtained area limited to a minimum of 4, 630 m2 (50,000 ft2). ', 'COMPARTMENTATION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC41', 'FSEC_CHECKLIST', 41, 'Provide smoke partition at enclosed areas of 2, 083 m2 (22, 500 ft2) or less with the length of 45.7m (150 ft) or less, with self-closing fire doors. ', 'COMPARTMENTATION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC42', 'FSEC_CHECKLIST', 42, 'Provide partition walls of two (2) hour fire resistance from floor to underside of floor above. ', 'COMPARTMENTATION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC43', 'FSEC_CHECKLIST', 43, 'Provide interior finish as follows; Exit; Class {0}   \r\nAccess to Exit; Class {1}                            \r\nOther Spaces;  Class {2}', 'COMPARTMENTATION ', 's,s,s');
INSERT INTO `obo_checklist_master` VALUES ('FSC44', 'FSEC_CHECKLIST', 44, 'Provide fire stopping for all concealed spaces.  ', 'COMPARTMENTATION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC45', 'FSEC_CHECKLIST', 45, 'Provide standard fire wall with at least 100 cm (39.38 in) high parapets on all portion of the building on the property line. ', 'WALLS', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC46', 'FSEC_CHECKLIST', 46, 'Extend exterior masonry walls to form parapets or wings.', 'WALLS', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC47', 'FSEC_CHECKLIST', 47, 'Provide protection of all exterior walls. All exterior walls facing approved alleys which are dead-ended must have a fire resistance of {0} hours. ', 'WALLS', 'd');
INSERT INTO `obo_checklist_master` VALUES ('FSC48', 'FSEC_CHECKLIST', 48, 'Provide automatic fire dampers on wall openings. ', 'WALLS', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC49', 'FSEC_CHECKLIST', 49, 'Provide protection of all walls. All exterior walls facing approved alleys which are dead-ended must have a fire dampers of {0} hours.', 'WARNING SYSTEMS', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC50', 'FSEC_CHECKLIST', 50, 'Provide approved type heat and smoke detection system. ', 'WARNING SYSTEMS', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC51', 'FSEC_CHECKLIST', 51, 'Provide efficient communication system for warning occupants and calling fire department. ', 'WARNING SYSTEMS', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC52', 'FSEC_CHECKLIST', 52, 'Provide approved type portable fire extinguisher (dry chemical) ABC type, {0} lbs. capacity for every 200 sq.m of floor area(low hazard), 100 sq. m floor area(moderate hazard) and 75 sq. m floor area(high hazard) areas or 22.8 m (75 ft) travel distance on every floor level. ', 'FIRE PROTECTION ', 'd');
INSERT INTO `obo_checklist_master` VALUES ('FSC53', 'FSEC_CHECKLIST', 53, 'Provide {0} with {1} mm riser and coupling of fire department standards with pumps of reliable pressure & connected to an adequate water supply tank. Hose and hose cabinet shall be provided at every hose gate valve on all floors. ', 'FIRE PROTECTION ', 's,d');
INSERT INTO `obo_checklist_master` VALUES ('FSC54', 'FSEC_CHECKLIST', 54, 'Provide Fire Service connection with a standard outlet of 64 mm, and 102 mm dry standpipe, and shall located on a street front. ', 'FIRE PROTECTION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC55', 'FSEC_CHECKLIST', 55, 'Provide automatic fire extinguishing system where kitchen equipment is located (Kitchenhood). ', 'FIRE PROTECTION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC56', 'FSEC_CHECKLIST', 56, 'Provide automatic chemical extinguishing system on all areas where electronic/electrical equipment are located. ', 'FIRE PROTECTION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC57', 'FSEC_CHECKLIST', 57, 'Provide approved-type automatic fire extinguishing system in accordance with NFPA 13.  Approval of system plan is required prior to installation ', 'FIRE PROTECTION ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC58', 'FSEC_CHECKLIST', 58, 'Provide outside window opening on bedrooms with a clear opening of not less than fifty six (56) cm in least dimension and forty five-hundredths (0.45) m2 in area. The bottom of the window shall be not more than one hundred twenty two (122) cm above the floor. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC59', 'FSEC_CHECKLIST', 59, 'All liquefied petroleum gas equipment including such equipment installed at utility gas plants shall be installed in accordance with the provisions of NFPA 59. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC60', 'FSEC_CHECKLIST', 60, 'No grills or any obstruction shall be installed on window openings and/or fire exits. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC61', 'FSEC_CHECKLIST', 61, 'Provide emergency lighting facilities with automatic transfer switch to AC/DC power source. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC62', 'FSEC_CHECKLIST', 62, 'Air conditioning ducts must be provided with approved fire dampers. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC63', 'FSEC_CHECKLIST', 63, 'Roof covering must be of non-combustible materials. Combustible roof covering must have fire retardant treatment. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC64', 'FSEC_CHECKLIST', 64, 'Provide fire escape ladder.', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC65', 'FSEC_CHECKLIST', 65, 'Provide fire escape stair. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC66', 'FSEC_CHECKLIST', 66, 'All unit partition wall shall be extended up to upper floor slab and/or one (1) meter above the roofline. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC67', 'FSEC_CHECKLIST', 67, 'Provide effective means of smoke ventilation such as access panels, movable windows. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC68', 'FSEC_CHECKLIST', 68, 'Project activity shall not affect the effectivity of the existing fire protection facilities. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC69', 'FSEC_CHECKLIST', 69, 'Provide/post allowable occupant load sign/s. Such signs shall be conspicuously and suitably located. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC70', 'FSEC_CHECKLIST', 70, 'Provide fire protection/suppression during construction. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC71', 'FSEC_CHECKLIST', 71, 'Provide fire exit plan for each floor of the building showing the routes from each room to appropriate exits, displayed prominently on the door of each room. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC72', 'FSEC_CHECKLIST', 72, 'No heating or lighting apparatus or equipment capable of igniting flammable materials shall be used in any storage or work area where rags, excelsior, hair or other highly flammable or combustible materials are stored or used. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC73', 'FSEC_CHECKLIST', 73, 'Provide/post \"NO SMOKING\" sign/s where combustible materials are stored or handled. Such signs shall be conspicuously and suitable located. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC74', 'FSEC_CHECKLIST', 74, 'If high hazard commodities will be stored/handled, automatic fire suppression system shall be provided.', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC75', 'FSEC_CHECKLIST', 75, 'Provide/post \"DO NOT USE ELEVATOR IN CASE OF FIRE\" sign/s. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC76', 'FSEC_CHECKLIST', 76, 'LPG tank/s must be installed outside the building and should be provided with safety devices that automatically stop the flow of gas should a leak develop. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC77', 'FSEC_CHECKLIST', 77, 'Provide fire resistive walls between stair & kitchen area. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC78', 'FSEC_CHECKLIST', 78, 'Provide outside window/s for rescue and ventilation with a minimum clear opening of 55 cm and approximately one half (0.5) m2 in area; the bottom of window opening is not more than eighty two (82) cm above the floor; it can readily be opened from the inside without the use of tools; where storm windows, screens, or antiburglar devices are used, these be provided with quick mechanism so that they may be so arranged that when opened they will not drop to the ground. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC79', 'FSEC_CHECKLIST', 79, 'Rooms used for kindergarten, first or second grade pupils shall not be located above or below the floor of exit discharge. Rooms used for second grade pupils shall not be located more than one (1) storey above the floor of exit discharge. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC80', 'FSEC_CHECKLIST', 80, 'Provide firefighters’ elevator. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC81', 'FSEC_CHECKLIST', 81, 'All correction indicated on the original approved plan from this office on {0} shall be followed. ', 'MISCELLANEOUS ', 's');
INSERT INTO `obo_checklist_master` VALUES ('FSC82', 'FSEC_CHECKLIST', 82, 'Any changes in occupancy other than stated shall be in accordance with Rule 10.  ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC83', 'FSEC_CHECKLIST', 83, 'Subject to inspection during construction.  ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC84', 'FSEC_CHECKLIST', 84, 'Fire Safety Inspection Certificate must be secured before/prior to issuance of Certificate of Occupancy. ', 'MISCELLANEOUS ', NULL);
INSERT INTO `obo_checklist_master` VALUES ('FSC85', 'FSEC_CHECKLIST', 85, 'Subject to additional requirements upon recommendation of the Fire Safety Inspector during construction phase and final inspection. ', 'MISCELLANEOUS ', NULL);
